import icon from '../pages/img/icon.jpg';
import FriendSingle from './FriendSingle'
const FriendsList = ({ friends, handleBackToProfile }) => {
    return (
        <div className="friends-list">
            <button onClick={handleBackToProfile}>Back to Profile</button>
            {friends.map(friend => (
                <FriendSingle key={friend._id} friend={friend} />
            ))}
        </div>
    );
};

export default FriendsList;
